import React from "react";

import {
  BrowserRouter as Router,
  Link,
  useRouteMatch,
  Route,
  Switch,
} from "react-router-dom";
import Registration from "./Registration";

function Registration_Landing() {
  const Nav = () => {
    <ul>
      <li>
        <Link to={`/registration/rental_agency`}>
          {" "}
          Rental Agency Registration
        </Link>
      </li>
      <li>
        <Link to={`/registration/customer`}>Customer Registration</Link>
      </li>
    </ul>;
  };
  return (
    <div>
      <Router>
        <Nav />
        <Route
          path="/registration/rental_agency"
          component={Registration}
        ></Route>
      </Router>
    </div>
  );
}

export default Registration_Landing;
